00.0, "y": 1351.95}, {"color": "#377eb8", "date": "1895", "id": "bib19227462_18951022_147640_246_0006_alto.xml-120-14", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eJag satt och lutade mig fram\u00e5t i sadeln d\u00e5 jag pl\u00f6tsligt k\u00e4nde\u003cbr\u003een f\u00f6rf\u00e4rlig \u003cb\u003est\u00f6t\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227462_18951022_147640_246_0006_alto.xml-120-14\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1742.25, "y": 1348.1}, {"color": "#377eb8", "date": "1903", "id": "bib11653838_19030717_147024_29_0002_alto.xml-215-23", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u00e5r varit mig i moders st\u00e4lle, d\u00e5 jag aldrig vetat af n\u00e5gon\u003cbr\u003eannan mor, f\u00f6rbarma dig \u00f6fver ditt v\u00e4rnl\u00f6sa barn \u2014 \u003cb\u003est\u00f6t\u003c/b\u003e mig\u003cbr\u003eicke tillbaka i den afgrund, ur hvilken jag som genom ett under\u003cbr\u003eblifvit r\u00e4ddad.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1903\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653838_19030717_147024_29_0002_alto.xml-215-23\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1943.05, "y": 1279.75}, {"color": "#377eb8", "date": "1896", "id": "bib11653815_18960819_146944_66_0003_alto.xml-122-14", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u2014 H\u00f6r nl, ropade ban till kyparen, akta er med kofferten,\u003cbr\u003e\u003cb\u003est\u00f6t\u003c/b\u003e honom icke mot r\u00e4ggeu!\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653815_18960819_146944_66_0003_alto.xml-122-14\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1999.4, "y": 1277.4}, {"color": "#377eb8", "date": "1895", "id": "bib15978012_18950926_148361_224_0002_alto.xml-78-11", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ede\", kastades hullar \u00f6rn buller, af den h\u00e4ftiga\u003cbr\u003e\u003cb\u003est\u00f6ten\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15978012_18950926_148361_224_0002_alto.xml-78-11\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1890.15, "y": 802.45}, {"color": "#377eb8", "date": "1897", "id": "bib11653811_18970310_145317_38_0003_alto.xml-114-23", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003erat ant\u00e4nder genom en gnista gasen i bal longen, som\u003cbr\u003enaturligtvis exploderar och med torpeden st\u00f6rtar mot jorden, hvarvid\u003cbr\u003espr\u00e4ng\u00e4mnet vid \u003cb\u003est\u00f6ten\u003c/b\u003e exploderar och ut\u00f6fvar sin f\u00f6rintande\u003cbr\u003everkan.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1897\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_18970310_145317_38_0003_alto.xml-114-23\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2078.1, "y": 1656.45}, {"color": "#377eb8", "date": "1896", "id": "bib11653815_18961125_146944_94_0004_alto.xml-6-7", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eJag k\u00e4nde i mitt bjerta en v\u00e5ldsam \u003cb\u003est\u00f6t\u003c/b\u003e som korn hela\u003cbr\u003emin varelse att sk\u00e4lfva, och i bufvudet ett slag, som tvang mig att\u003cbr\u003esluta \u00f6gonen Mili f\u00f6rvirring var f\u00f6r tydlig, f\u00f6r att min fader ej\u003cbr\u003eskulle m\u00e4rka den, och lian utropade helt f\u00f6rskr\u00e4ckt: \u2014 Carlos, min\u003cbr\u003eson, hvad g\u00e5r \u00e5t dig?\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653815_18961125_146944_94_0004_alto.xml-6-7\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2572.65, "y": 1080.2}, {"color": "#377eb8", "date": "1895", "id": "bib19225758_18950527_144022_121_0003_alto.xml-109-29", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eskador m\u00e4rktes ej med undantag af ett par obetydliga skr\u00e5mor i\u003cbr\u003eansiktet, men medvetsl\u00f6sheten f\u00f6rorsakades enligt l\u00e4karnes utsago af\u003cbr\u003een vidt utbredd hj\u00e4rnbl\u00f6dning, framkallad af den h\u00e4ftiga \u003cb\u003est\u00f6ten\u003c/b\u003e\u003cbr\u003evid fallet och hvilken nu, som n\u00e4mnts, medf\u00f6rt d\u00f6den.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19225758_18950527_144022_121_0003_alto.xml-109-29\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1983.35, "y": 1100.85}, {"color": "#377eb8", "date": "1895", "id": "bib19349359_18951219_148383_150_0003_alto.xml-131-10", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDerp\u00e5 intr\u00e4ffade under ett par sekunder en f\u00f6ljd af l\u00e4ttare\u003cbr\u003e\u003cb\u003est\u00f6tar\u003c/b\u003e, hvilka erforos s\u00e5som en darrning i byggnadernas\u003cbr\u003egrundvalar.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19349359_18951219_148383_150_0003_alto.xml-131-10\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1869.15, "y": 1321.35}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18950904_147683_240_0006_alto.xml-45-12", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003efiskarena till sj\u00f6s skulle mi skyttarno till lands taga omot\u003cbr\u003edon f\u00f6rsta \u003cb\u003est\u00f6ten\u003c/b\u003e af flendon.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18950904_147683_240_0006_alto.xml-45-12\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1839.3, "y": 1141.95}, {"color": "#377eb8", "date": "1895", "id": "bib15760600_18950521_146401_60_0004_alto.xml-23-8", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eVid li-tiden m\u00e4rktes en ny, l\u00e4ttare jord \u003cb\u003est\u00f6t\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15760600_18950521_146401_60_0004_alto.xml-23-8\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1655.4, "y": 1710.3}, {"color": "#377eb8", "date": "1897", "id": "bib11653830_18970726_146968_59_0003_alto.xml-162-36", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMan bar n\u00e4mligen uppt\u00e4ckt, att det i byggnadens k\u00e4llare \u2014 af\u003cbr\u003eof\u00f6rklarlig anledning \u2014 f\u00f6rvaras stora m\u00e4ngder dynamit, som befinner\u003cbr\u003esig i s\u00e5dant tillst\u00e5nd, att den kan explodera vid den minsta skakning\u003cbr\u003eeller \u003cb\u003est\u00f6t\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1897\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653830_18970726_146968_59_0003_alto.xml-162-36\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1477.7, "y": 1594.9}, {"color": "#377eb8", "date": "1895", "id": "bib15650837_18950129_146391_24_0003_alto.xml-4-8", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003en\u00e4stan oafbrutet f\u00f6ljt mer eller mindre starka jord\u003cbr\u003e\u003cb\u003eSt\u00f6tar\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15650837_18950129_146391_24_0003_alto.xml-4-8\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1659.95, "y": 1470.5}, {"color": "#377eb8", "date": "1895", "id": "bib11653836_18950927_147011_39_0003_alto.xml-105-1", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eh\u00e4ftig \u003cb\u003est\u00f6t\u003c/b\u003e; b\u00e5ten kr\u00e4ngde f\u00f6rst h\u00e4ftigt \u00f6fver \u00e5t\u003cbr\u003ebabords sida samt gjorde sedan n\u00e5gra h\u00e4ftiga vickningar.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653836_18950927_147011_39_0003_alto.xml-105-1\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2595.45, "y": 1457.2}, {"color": "#377eb8", "date": "1895", "id": "bib15760690_18950617_145050_91_0002_alto.xml-73-59", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003edenna notis med att mannen i fr\u00e4ga, hwilken naturligtwis icke\u003cbr\u003e\u00e4r normal, lika tr\u00e4get infinner sig p\u00e4 andra Stockholms polisstationer\u003cbr\u003eoch framf\u00f6r sina klagom\u00e4l, samt \u00e4fwen g\u00f6r bes\u00f6k p\u00e4 alla Stockholms\u003cbr\u003epostkontor, manligen begynnande med s\u00f6dra filialkontoret, sr\u00e4gar, \u2014\u003cbr\u003ewanligtwis lugn, glad och artigt bugande, men stundom med bistermin\u003cbr\u003eoch medelst \u003cb\u003est\u00f6tar\u003c/b\u003e i golfwet med sin kn\u00f6lp\u00e4k \u2014 efter bref, som\u003cbr\u003ehan p\u00e4si\u00e4r posten s\u00f6ker undanh\u00e4lla honom; och fast\u00e4n han hwarje g\u00e4ng\u003cbr\u003efar besked, att ingenting finnes f\u00f6r hans r\u00e4kning, \u00e4terkommer han\u003cbr\u003en\u00e4sta s\u00f6neller helgdag i samma \u00e4rende.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15760690_18950617_145050_91_0002_alto.xml-73-59\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2080.95, "y": 491.845}, {"color": "#377eb8", "date": "1895", "id": "bib19225758_18951125_144022_275_0004_alto.xml-50-17", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003efartygets kurser, \u00e4r det otvifvelaktigt, att \u00bb Lord Bangor \u00bb\u003cbr\u003ehar h\u00f6rt en god del \u003cb\u003est\u00f6tar\u003c/b\u003e af bogser b\u00e5tens \u00e5nghvissla p\u00e5 sin\u003cbr\u003estyrbords bog; man visste allts\u00e5 ombord i \u00e5ngaren, att en annan \u00e5ngare\u003cbr\u003egradvis stack tv\u00e4rs f\u00f6rbi bogen, och det b\u00f6r hafva varit \u00f6gonblick, d\u00e5\u003cbr\u003edet stod klart f\u00f6r kaptenen, alt det l\u00e5ngt ifr\u00e5n f\u00f6rel\u00e5g\u003cbr\u003es\u00e4kcrhetstecken, s\u00e5dana som lagen kr\u00e4fver skola vara tillst\u00e4des, utan\u003cbr\u003eatt det tv\u00e4rs emot p\u00e5trugades honom k\u00e4nnetecken, som gingo i motsatt\u003cbr\u003eriktning.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19225758_18951125_144022_275_0004_alto.xml-50-17\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1731.8, "y": 1003.15}, {"color": "#377eb8", "date": "1895", "id": "bib15975090_18950416_148377_45_0003_alto.xml-73-9", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOch detta tysta samtal gick genast som en elektrisk \u003cb\u003est\u00f6t\u003c/b\u003e\u003cbr\u003egenom hela det resande s\u00e4llskapet, som befann sig p\u00e5 den l\u00e5nga\u003cbr\u003eb\u00e4nken.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15975090_18950416_148377_45_0003_alto.xml-73-9\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1777.2, "y": 1572.3}, {"color": "#377eb8", "date": "1903", "id": "bib11653811_19030107_145317_4_0003_alto.xml-49-7", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eKammarens \u00e4ndam\u00e5l \u00e4r att d\u00e4mpa ljudet af \u003cb\u003est\u00f6tarna\u003c/b\u003e, d\u00e5\u003cbr\u003eden f\u00f6rbr\u00e4nda gasen vid explosionen utst\u00f6tes ur motorerna.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1903\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_19030107_145317_4_0003_alto.xml-49-7\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2479.75, "y": 1413.1}, {"color": "#377eb8", "date": "1898", "id": "bib11653811_18980223_145317_30_0003_alto.xml-117-7", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eWelins f\u00f6rsta tanke, d\u00e5 ban k\u00e4nde \u003cb\u003est\u00f6ten\u003c/b\u003e, var, att man\u003cbr\u003ekommit p\u00e5 Horns ref, bans andra tanke att komma upp p\u00e5 d\u00e4ck.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1898\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_18980223_145317_30_0003_alto.xml-117-7\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1806.35, "y": 1116.05}, {"color": "#377eb8", "date": "1895", "id": "bib15760600_18950627_146401_75_0002_alto.xml-198-70", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003emellan Kils nedre station ocb Fryksta intr\u00e4ffade i tisdags\u003cbr\u003emorse vid 9 tiden den olyckan, att en extra banvakt \u2014 f\u00f6r \u00f6frigt\u003cbr\u003earbetare vid Fryksta \u2014 vid namn G. Eriksson i en kurva t\u00f6rnade med sin\u003cbr\u003etralla tillsammans mod det fr\u00e5n Fryksta kommande t\u00e5get, med det\u003cbr\u003eresultat, att E., d\u00e5 han s\u00f6kte r\u00e4dda trallan, erh\u00f6ll flera allvarliga\u003cbr\u003ekontusioner i huf vudet samt en stark \u003cb\u003est\u00f6t\u003c/b\u003e i sidan ofvanf\u00f6r\u003cbr\u003ev\u00e4nstra h\u00f6ften.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15760600_18950627_146401_75_0002_alto.xml-198-70\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2378.85, "y": 1372.25}, {"color": "#377eb8", "date": "1895", "id": "bib19225758_18950220_144022_43_0002_alto.xml-111-35", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eUmberto hade genom ett anfall af \u00f6sterrikiska ulaner blifvit\u003cbr\u003eskild fr\u00e5n sin di vision; en ulan h\u00f6jde sin lans f\u00f6r att st\u00f6ta ned\u003cbr\u003ehonom, men Rossi kastade sig blixtsnabbt framf\u00f6r kronprinsen och\u003cbr\u003emottog \u003cb\u003est\u00f6ten\u003c/b\u003e i armen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19225758_18950220_144022_43_0002_alto.xml-111-35\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1701.4, "y": 1217.2}, {"color": "#377eb8", "date": "1895", "id": "bib15761570_18950626_146176_105_0002_alto.xml-144-19", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eatt han, d\u00e5 styrmannen efter kollisionen intr\u00e4dde i hans hytt,\u003cbr\u003eblott fr\u00e5gat: \u2018 Kommer det flera \u003cb\u003est\u00f6tar\u003c/b\u003e?\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15761570_18950626_146176_105_0002_alto.xml-144-19\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2032.95, "y": 1711.85}, {"color": "#377eb8", "date": "1895", "id": "bib15650814_18950502_146365_102_0001_alto.xml-56-14", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u2014 H\u00f6r ni, ropade han till kyparen, akta er med kofferten,\u003cbr\u003e\u003cb\u003est\u00f6t\u003c/b\u003e honom icke emot v\u00e4ggen!\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15650814_18950502_146365_102_0001_alto.xml-56-14\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2025.15, "y": 874.9}, {"color": "#377eb8", "date": "1895", "id": "bib15650814_18951003_146365_231_0002_alto.xml-70-7", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u00e4r intryckt och vittnar till fullo om \u003cb\u003est\u00f6tens\u003c/b\u003e \u0027 enorma\u003cbr\u003eh\u00e4ftighet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15650814_18951003_146365_231_0002_alto.xml-70-7\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2297.5, "y": 1493.25}, {"color": "#377eb8", "date": "1902", "id": "bib11653790_19020617_145648_47_0004_alto.xml-111-7", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMea J\u00f6dde h\u00e4mtade sig r\u00e5tt fort efter \u003cb\u003est\u00f6ten\u003c/b\u003e och s\u00e5\u003cbr\u003ebarkade vi \u00e5nyo ihop och slogos s\u00e5 att blodet skvatt om v\u00e5ra\u003cbr\u003en\u00e4sor.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1902\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_19020617_145648_47_0004_alto.xml-111-7\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2157.25, "y": 1678.8}, {"color": "#377eb8", "date": "1895", "id": "bib15760690_18950601_145050_83_0002_alto.xml-150-10", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eLugnande flrifwelser fr\u00e4n myndigheterna kungjordes, och d\u00e4 inga\u003cbr\u003ewidare \u003cb\u003est\u00f6tar\u003c/b\u003e vrm\u00e4rktes, f\u00f6ljde p\u00e4 s\u00f6ndagen oafbruten b\u00f6n och\u003cbr\u003egudstjenst i kyrkorna, dit folk str\u00f6mmade med ljus och blommor.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15760690_18950601_145050_83_0002_alto.xml-150-10\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1303.9, "y": 1614.65}, {"color": "#377eb8", "date": "1895", "id": "bib15869824_18950706_145700_54_0003_alto.xml-18-26", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eN\u00e5gra ynglingar fr\u00e5n Vifstavarf, som vo ro ute i en b\u00e5t i\u003cbr\u003eAln\u00f6sundet, k\u00e4nde tyd ligt, huru b\u00e5ten Hstades och b\u00f6rjade vagga af\u003cbr\u003e\u003cb\u003est\u00f6ten\u003c/b\u003e; de trodde sig hafva kommit p\u00e5 n\u00e5got ok\u00e4ndt\u003cbr\u003egrund.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15869824_18950706_145700_54_0003_alto.xml-18-26\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1650.65, "y": 956.0}, {"color": "#377eb8", "date": "1895", "id": "bib19225758_18950921_144022_220_0007_alto.xml-228-5", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003etafvelramarne och juvelerna mot m\u00f6jliga \u003cb\u003est\u00f6tar\u003c/b\u003e under\u003cbr\u003eresan, D\u00e5 kapps\u00e4cken slutligen var \u00f6fverfylld, drog Kodom tillsammans\u003cbr\u003edragremmarne lika s\u00e5 v\u00e5rdsl\u00f6st, som hade der varit fr\u00e5ga om en\u003cbr\u003enatts\u00e4ck, inneh\u00e5llande litet kl\u00e4der och linne.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19225758_18950921_144022_220_0007_alto.xml-228-5\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1641.8, "y": 1781.1}, {"color": "#377eb8", "date": "1902", "id": "bib11653838_19020815_147024_33_0003_alto.xml-198-36", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003evar d\u00e5 6,30 f. m. \u201d \u201d Skedde ingen skada vid nedstigningen? \u201d \u201d\u003cbr\u003eJo, ballongen fick en repa, skyddst\u00e4ltet blef ocks\u00e5 ramponeradt \u00bb och\u003cbr\u003egondolen var naturligtvis utsatt f\u00f6r ganska kraftiga\u003cbr\u003e\u003cb\u003est\u00f6tar\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1902\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653838_19020815_147024_33_0003_alto.xml-198-36\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1596.4, "y": 1264.35}, {"color": "#377eb8", "date": "1895", "id": "bib15873371_18950516_145112_132_0002_alto.xml-117-6", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ei maskinen, k\u00e4nde en stark \u003cb\u003est\u00f6t\u003c/b\u003e och b\u00e5de han ooh f\u00f6raren\u003cbr\u003ehade d\u00e5 t\u00e5get passerade grindarna krupit in i ena h\u00f6rnet af maskinen,\u003cbr\u003eunder det bromsaren p\u00e4 en af godsvagnarne af lufttryckningen str\u00e4okts\u003cbr\u003ebakl\u00e4nges p\u00e5 vagnen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873371_18950516_145112_132_0002_alto.xml-117-6\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1875.9, "y": 679.65}, {"color": "#377eb8", "date": "1900", "id": "bib11653838_19000615_147024_24_0002_alto.xml-160-38", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eh\u00e4nde sig dock ej b\u00e4ttre, s\u00e4ger Hudiksvalls Posten, \u00e4n att\u003cbr\u003e\u00e5skan samtidigt \u00d6fverrumplade, hvilket \u00e4fven i telefonen gaf sig till\u003cbr\u003ek\u00e4nna p\u00e5 ett eftertryckligt s\u00e4tt, i det samtidigt deri talande fick en\u003cbr\u003es\u00e5 kraftig \u003cb\u003est\u00f6t\u003c/b\u003e att han f\u00f6ll \u00f6fver en n\u00e4rst\u00e5ende stol, tappade\u003cbr\u003eluren ur handen och fick sm\u00e4rtsamma k\u00e4nningar i venstra sidans arm och\u003cbr\u003eben samt bl\u00e5nad omkring samma sidas \u00f6ga.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1900\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653838_19000615_147024_24_0002_alto.xml-160-38\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1608.55, "y": 1672.4}, {"color": "#377eb8", "date": "1895", "id": "bib11653790_18951129_145648_49_0003_alto.xml-44-25", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eAtt explosionen kunde intr\u00e4ffa synes hafva haft sin orsak d\u00e4ri,\u003cbr\u003eatt stiftet, som f\u00f6r utdragarens p\u00e5k\u00e4nningar kommit n\u00e5got snedt, i och\u003cbr\u003emed \u003cb\u003est\u00f6ten\u003c/b\u003e snuddat mot urfr\u00e4sningen i b\u00f6ssan, och att\u003cbr\u003ehagelskottet till all lycka ej tog den vanliga utv\u00e4gen fram\u00e5t, synes\u003cbr\u003ehafva berott p\u00e5 st\u00f6tens kraft, hvarigenom patronen f\u00e5tt s\u00e5dan fart,\u003cbr\u003eatt den redan hunnit till en del l\u00e4mna b\u00f6ssan, d\u00e5 skottet gick\u003cbr\u003eaf.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_18951129_145648_49_0003_alto.xml-44-25\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2389.6, "y": 1603.2}, {"color": "#377eb8", "date": "1895", "id": "bib19227291_18950417_145289_45_0003_alto.xml-84-35", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eGraz och Agram meddelas jordskalf, och sjelfva Wien intr\u00e4ffade\u003cbr\u003ekl. half tolf i natt en svag jordst\u00f6t, som emellertid f\u00f6r de fleste\u003cbr\u003eaflopp n\u00e4stan obem\u00e4rkt, men klockor och telegrafappater stannade\u003cbr\u003edelvis vid \u003cb\u003est\u00f6ten\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227291_18950417_145289_45_0003_alto.xml-84-35\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1511.55, "y": 1509.95}, {"color": "#377eb8", "date": "1895", "id": "bib11653811_18951122_145317_181_0002_alto.xml-87-18", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e(af jern) var slagen tv\u00e4rt af, hvilket bevisar att disken\u003cbr\u003efallit omkull med en h\u00e5rd \u003cb\u003est\u00f6t\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_18951122_145317_181_0002_alto.xml-87-18\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2159.0, "y": 849.8}, {"color": "#377eb8", "date": "1898", "id": "bib11653811_18980815_145317_124_0003_alto.xml-43-10", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003estund derefter var det som \u00f6rn han f\u00e5tt en h\u00e4ftig \u003cb\u003est\u00f6t\u003c/b\u003e\u003cbr\u003ef\u00f6r br\u00f6stet, nu var det hans tur att falla och blifva nedtrampad af\u003cbr\u003efiendens h\u00e4star.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1898\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_18980815_145317_124_0003_alto.xml-43-10\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2245.7, "y": 558.2}, {"color": "#377eb8", "date": "1895", "id": "bib19225758_18950917_144022_216_0002_alto.xml-32-23", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet sista telegrammet i g\u00e5r omtalade, att A-k\u00e5ren tidigt p\u00e5\u003cbr\u003emorgonen gick till anfall mot Hardemo, hvarvid G\u00f6ta lifgarde mottog\u003cbr\u003ef\u00f6rsta \u003cb\u003est\u00f6ten\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19225758_18950917_144022_216_0002_alto.xml-32-23\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1505.25, "y": 1665.55}, {"color": "#377eb8", "date": "1895", "id": "bib11653811_18951224_145317_200_0002_alto.xml-112-18", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOch d\u00e5 han s\u00e5g att den unge mannen m\u00e5ste h\u00e5lla sig fast vid den\u003cbr\u003emotsatta husraden, dit \u003cb\u003est\u00f6tens\u003c/b\u003e v\u00e5ldsamhet slungat honom,\u003cbr\u003etillade han med ironisk artighet: \u2014 Ers n\u00e5d har v\u00e4l inte f\u00e5tt n\u00e5gon\u003cbr\u003el\u00e4cka under vattenlinjen?\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_18951224_145317_200_0002_alto.xml-112-18\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2184.0, "y": 1174.2}, {"color": "#377eb8", "date": "1895", "id": "bib11653811_18950927_145317_149_0001_alto.xml-56-1", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eh\u00e4ftiga \u003cb\u003est\u00f6ten\u003c/b\u003e uppstod naturligtvis stor oreda om bord,\u003cbr\u003ei det alla l\u00f6sa f\u00f6rem\u00e5l rubbades eller f\u00f6llo huller om buller.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_18950927_145317_149_0001_alto.xml-56-1\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2084.8, "y": 1356.85}, {"color": "#377eb8", "date": "1897", "id": "bib11653811_18970611_145317_88_0003_alto.xml-37-4", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eatt beakta, att \u003cb\u003est\u00f6tar\u003c/b\u003e eller slag med trubbigt eller\u003cbr\u003etrubbkantigt f\u00f6rem\u00e5l, nog kraftiga att under f\u00f6r \u00f6frigt derf\u00f6r l\u00e4mpade\u003cbr\u003ef\u00f6rh\u00e5llanden \u00e5stadkomma dylika fingerbrott, icke med n\u00f6dv\u00e4ndighet\u003cbr\u003ebeh\u00f6fva medf\u00f6ra mera f\u00f6r\u00e4ndringar i huden och underhudsv\u00e4fnaden, \u00e4n de\u003cbr\u003eh\u00e4r iakttagna.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1897\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_18970611_145317_88_0003_alto.xml-37-4\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1933.15, "y": 1205.2}, {"color": "#377eb8", "date": "1896", "id": "bib19227291_18960813_145289_97_0004_alto.xml-50-13", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e- frii \u00bb j!\u201c, Detta sista uttryck framkallades af en\u003cbr\u003e\u003cb\u003est\u00f6t\u003c/b\u003e, som Zita fick och som slungade henne fram\u00e5t, och \u00f6rn Mark\u003cbr\u003eicke skyddande str\u00e4ckt sina armar ut emot henne, s\u00e5 hade hon\u003cbr\u003es\u00e4kerligen slagit sig illa mot vagnens motsatta sidov\u00e4gg.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227291_18960813_145289_97_0004_alto.xml-50-13\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2036.4, "y": 1212.1}, {"color": "#377eb8", "date": "1896", "id": "bib15873936_18960527_147385_61_0002_alto.xml-108-5", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003esofvo, v\u00e4cktes af en \u003cb\u003est\u00f6t\u003c/b\u003e, som kastade upp hyttd\u00f6rrar o.\u003cbr\u003es. v. I den allm\u00e4nna f\u00f6rvirring och f\u00f6rskr\u00e4ckelse som uppstod l\u00e4r en i\u003cbr\u003eKungs\u00f6r hemmah\u00f6rande passagerare varit nog kallblodig att yttra: \u00bb\u003cbr\u003eVar\u00e9n inte r\u00e4dda, den h\u00e4r b\u00e5ten \u00e4r van att g\u00e5 p\u00e5 land \u00bb.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873936_18960527_147385_61_0002_alto.xml-108-5\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1692.4, "y": 1181.1}, {"color": "#377eb8", "date": "1895", "id": "bib19227462_18950802_147640_177_0003_alto.xml-178-7", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDenna bittra f\u00f6rebr\u00e5else tr\u00e4ffade som en dolk \u003cb\u003est\u00f6t\u003c/b\u003e\u003cbr\u003eCiarissas bjerta.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227462_18950802_147640_177_0003_alto.xml-178-7\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1965.25, "y": 1596.55}, {"color": "#377eb8", "date": "1899", "id": "bib11653811_18990918_145317_143_0002_alto.xml-93-2", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDenna motstod \u003cb\u003est\u00f6ten\u003c/b\u003e n\u00e5gra sekunder, men gaf derefter\u003cbr\u003evika och f\u00f6ll p\u00e5 den tredje, som i sin ordning f\u00f6ll p\u00e5 den fjerde o.\u003cbr\u003es. v., s\u00e5 att slutligen hela den v\u00e4ldiga \u00d6fverbyggnaden f\u00f6ll ihop likt\u003cbr\u003eett korthus.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1899\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_18990918_145317_143_0002_alto.xml-93-2\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2191.45, "y": 1375.9}, {"color": "#377eb8", "date": "1901", "id": "bib11653838_19010215_147024_7_0002_alto.xml-78-8", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eD\u00e5 faiiandesoten ans\u00e5gs h\u00e4rleda sig af en efter \u003cb\u003est\u00f6ten\u003c/b\u003e\u003cbr\u003euppkommen vare sig bensplittrmg, utgjutmng eller svulst i hj\u00e4rnan,\u003cbr\u003eofve!\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1901\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653838_19010215_147024_7_0002_alto.xml-78-8\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2098.55, "y": 1286.65}, {"color": "#377eb8", "date": "1895", "id": "bib19227462_18950820_147640_192_0003_alto.xml-198-11", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003espiraler hr Johansson lyckats borttaga eller \u00e5tminstone\u003cbr\u003enedbriDga till en obetydlighet \u003cb\u003est\u00f6tar\u003c/b\u003e och ryckningar.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227462_18950820_147640_192_0003_alto.xml-198-11\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2011.9, "y": 1418.5}, {"color": "#377eb8", "date": "1895", "id": "bib19277330_18950316_0_32_0002_alto.xml-90-3", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ef\u00e5tt en sv\u00e5r \u003cb\u003est\u00f6t\u 0bb dags p\u00e4 Merserums\u003cbr\u003estation och f\u00f6rorsakade, att tjenstg\u00f6rande stationsf\u00f6rest\u00e5ndaren\u003cbr\u003eerh\u00f6ll en elektrisk \u003cb\u003est\u00f6t\u003c/b\u003e, s\u00e5 att han f\u00f6ll af stolen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19349359_18950817_148383_97_0002_alto.xml-156-20\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1267.1, "y": 834.0}, {"color": "k", "date": "1902", "id": "bib11653790_19021003_145648_77_0003_alto.xml-184-23", "label": "-1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eN\u00e4r en l\u00e4tt st\u00f6t skakar vagnen, l\u00e4gger han strax beskyddande\u003cbr\u003esin arm om sin sk\u00f6na reskamrats lif f\u00f6r att d\u00e4mpa v\u00e4rkan af\u003cbr\u003e\u003cb\u003est\u00f6ten\u003c/b\u003e, ooh ofta snuddar han milt?id hennes hvita hand f\u00f6r att\u003cbr\u003ef\u00f6rvissa sig om, att hon icke fryser eller \u00e4r f\u00f6r varm.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1902\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_19021003_145648_77_0003_alto.xml-184-23\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2568.25, "y": 1550.95}, {"color": "k", "date": "1897", "id": "bib11653815_18970426_146944_46_0003_alto.xml-60-51", "label": "-1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e(Konung Umberto har so u tekant en rik erfarenhet i fr\u00e5ga \u00f6rn\u003cbr\u003eattentat, att s\u00e4rskildt nanida Passanantes \u00e5r 1878 i Neapel, d\u00e5\u003cbr\u003eattentatorn likaledes hoppade upp i vagnen och st\u00f6tte efter konungen\u003cbr\u003emed en dolk, mea afv\u00e4pnides, efter det ko nungen med Cairolis, hj\u00e4lp\u003cbr\u003eparerat \u003cb\u003est\u00f6ten\u003c/b\u003e).\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1897\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653815_18970426_146944_46_0003_alto.xml-60-51\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2588.35, "y": 1168.55}, {"color": "k", "date": "1895", "id": "bib11653811_18950615_145317_91_0003_alto.xml-104-34", "label": "-1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003edock ingenting, s\u00e4 Per Johan fick los att g\u00e4 \u00f6fwer till\" den\u003cbr\u003esignade dag\" och\" som s\u00e4glar sm\u00e5\" och m\u00e4nga andra verser, som han\u003cbr\u003ekunde utantill, innan \u003cb\u003est\u00f6ten\u003c/b\u003e, p\u00e4 juristens uppmaning, gick upp\u003cbr\u003etill honom och fr\u00e4gade hwad han wille.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_18950615_145317_91_0003_alto.xml-104-34\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1267.1, "y": 702.0}, {"color": "k", "date": "1895", "id": "bib15760690_18951121_145050_180_0003_alto.xml-137-17", "label": "-1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDirk Starreberg, \u2014 han war ej l\u00e4ngre min make \u2014 dog f\u00f6r min\u003cbr\u003ehand, jag \u003cb\u003est\u00f6t\u003c/b\u003e ihj\u00e4l honom, der han fatt wid elden.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15760690_18951121_145050_180_0003_alto.xml-137-17\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1532.95, "y": 1978.55}, {"color": "k", "date": "1895", "id": "bib15650835_18950712_146472_59_0004_alto.xml-55-28", "label": "-1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eowanligt tr\u00f6g f\u00f6r att wara en\" borstis\", och innan han hann f\u00e4\u003cbr\u003esina borstar i ordning, kom en annan, st\u00f6rre pojke framspringande,\u003cbr\u003e\u003cb\u003est\u00f6t\u003c/b\u003e undan honom och sade: \u2014 G\u00e4 och s\u00e4tt dig, Jimmy; jag tar\u003cbr\u003edet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15650835_18950712_146472_59_0004_alto.xml-55-28\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2163.8, "y": 514.5}, {"color": "k", "date": "1895", "id": "bib11653815_18950822_146944_99_0003_alto.xml-103-1", "label": "-1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eGrefven \u003cb\u003est\u00f6t\u003c/b\u003e honom lade idig t i sin famn.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653815_18950822_146944_99_0003_alto.xml-103-1\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2273.15, "y": 330.15}, {"color": "k", "date": "1895", "id": "bib19225758_18950112_144022_10_0002_alto.xml-126-11", "label": "-1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ekomma m\u00f6ten att \u00e5rligen sammankallas f\u00f6r diskussion af\u003cbr\u003ejuridiska fr\u00e5gor af \u003cb\u003est\u00f6t\u003c/b\u003e re intresse.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19225758_18950112_144022_10_0002_alto.xml-126-11\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1201.1, "y": 1263.0}, {"color": "k", "date": "1900", "id" \"\u003e\u003c/span\u003eD\u00e5 han satt den ena timmen efter den andra och betraktade\u003cbr\u003ehenne, i stum, obest\u00e4md f\u00f6rf\u00e4ran, alltid med hennes hand i sin, kommo\u003cbr\u003ehans andedrag i korta \u003cb\u003est\u00f6tar\u003c/b\u003e med stor anstr\u00e4ngning, hans \u00f6gon\u003cbr\u003eomt\u00f6cknades, hans l\u00e4ppar Dlefvo m\u00f6rkbl\u00e5, torra och sprucKna, och\u003cbr\u003esjelfva blodet cirkulerade l\u00e5ngsammare i hans \u00e5dror.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873371_18950314_145112_72_0002_alto.xml-255-31\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1321.9, "y": 1092.15}, {"color": "#999999", "date": "1901", "id": "bib11653790_19011119_145648_91_0004_alto.xml-10-21", "label": "6", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003emanlige tj\u00e4narne fullpackat tj\u00e4nstebyr\u00e5erna och st\u00e5 i klungor\u003cbr\u003ed\u00e4rutanf\u00f6r, modstulna och f\u00f6rsagda, komma tj\u00e4nsteflickorna h\u00f6gst tv\u00e5\u003cbr\u003eeller tre i \u003cb\u003est\u00f6ten\u003c/b\u003e, fr\u00e5ga krytt \u00f6rn \u00bb d\u00e4r finns n\u00e5got \u00bb,\u003cbr\u003euppg\u00f6ra \u00f6rn sin anst\u00e4llning ganska sj\u00e4lfmedvetet och bet\u00e4nksamt eller\u003cbr\u003esl\u00e5 en knyck p\u00e5 nacken och lofva att \u00e5terkomma \u00f6rn det erbjudna \u00bb inte\u003cbr\u003epassar \u00bb.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1901\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_19011119_145648_91_0004_alto.xml-10-21\u003cbr\u003etype: usage\u003c/p\u003e", "x": 109.84, "y": 1282.65}, {"color": "#999999", "date": "1895", "id": "bib19277301_18950916_145146_75_0006_alto.xml-26-9", "label": "6", "physics": false, "shape": "circl
